import { Component, OnInit } from '@angular/core';
import { BookService } from 'src/app/services/book.service';
import { UserStoreService } from 'src/app/services/user-store.service';
import { UserService } from 'src/app/services/user.service';

@Component({
  selector: 'app-dashboard',
  templateUrl: './dashboard.component.html',
  styleUrls: ['./dashboard.component.css']
})
export class DashboardComponent implements OnInit {
  availableBooks:any
  constructor(private userStoreService:UserStoreService,private userService:UserService,private bookService:BookService){}
  ngOnInit(): void {
    const username=this.userService.getUsernameFromToken();
    this.userStoreService.setData(username);
    this.bookService.getAvailableBooks().subscribe((res)=>{
      console.log(res.$values);
      this.availableBooks=res.$values;
    },(error)=>{
      console.log(error);
    })
  }
}
